import React from "react";
import logo from "./logo.svg";
import fontenay from "./fontenay.jpg";
import koh from "./koh.jpg";
import RuPauls from "./RuPauls.pnj";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="Split">
        <img src={RuPauls} className="App-logo" alt="RuPauls" />
        <img src={fontenay} alt="fontenay" />
        <img src={koh} className="denis" alt="denis" />
      </header>
    </div>
  );
}

export default App;
